create table MASTER
(
    DATA_REG         VARCHAR2(19) not null,
    CODICE_PROVINCIA NUMBER       not null
        constraint MASTER_PROVINCE_FK
            references PROVINCE
                on delete cascade,
    TOTALE_CASI      NUMBER       not null,
    NOTE_IT          VARCHAR2(10),
    NOTE_EN          VARCHAR2(10),
    primary key (DATA_REG, CODICE_PROVINCIA)
);

